import React from 'react';
import { Route, BrowserRouter } from 'react-router-dom';
import Routes from './routes-nav/Routes';
import Home from './Home';
import './App.css';

function App() {
	return (
		<BrowserRouter>
			<div className="App">
				<Route exact path="/">
					<Home />
				</Route>
			</div>
		</BrowserRouter>
	);
}

export default App;
